import React, {Fragment} from 'react'

const Interests = ({ interests }) => {
    // const singleInterest = (interest) => {
    //     return (
    //         <p>{interest}</p>
    //     )
    // }

    const showInterest = (interests) => {
        const items =[];
        for(const key in interests){
            items.push(<li>{interests[key].interest}</li>);
        }
    }
    return (
        <Fragment>{showInterest(interests)}</Fragment>
    )
}

export default Interests
